import React from "react";
import { Navbar } from "./Navbar";
import ImagesCarousel from "./ImagesCarousel";
import Carousel from "./Carousel";

function Accueil() {
  return (
    <div>
      <Navbar />
      {/* <ImagesCarousel /> */}
      <Carousel
        style={{
          width: 100,
        }}
      />
    </div>
  );
}

export default Accueil;
